import Card from "./components/Card";
import Header from "./components/Header";
import Drawer from "./components/Drawer"
import card from "./components/Card";

const arr  = [
    {name: 'Мужские Кроссовки Nike Blazer Mid Suede', price: '12 999 руб.', imageUrl: ' /img/sneakers/1.jpg'},
    {name: 'Мужские Кроссовки Nike Air Max 270',  price: '12 999 руб.', imageUrl: ' /img/sneakers/2.jpg' },
    {name: 'Мужские Кроссовки Nike Blazer Mid Suede',  price: '8 499 руб.', imageUrl: ' /img/sneakers/3.jpg'},
    {name: 'Кроссовки Puma X Aka Boku Future Rider',  price: '8 999 руб.', imageUrl: ' /img/sneakers/4.jpg'},
]

function App() {
  return (
    <div className="wrapper clear">
        <Drawer />
        <Header />
      <section className="content p-40">
          <div className="d-flex justify-between align-center mb-40">
              <h1>Все кроссовки</h1>
              <div className="search-block">
                  <img src="/img/search.svg" alt="search"/>
                  <input placeholder="Поиск..." type="text"/>
              </div>
          </div>
          <div className="d-flex">
              {arr.map((obj) =>(<Card title={obj.name} price={obj.price} imageUrl={obj.imageUrl} /> ))}
          </div>
      </section>
    </div>
  );
}
export default App;
